webpackJsonp([0x709b5c20bee1],{8534:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Score One for the Tagesschau",date:"28 Jul 2004",slug:"/2004-07-28-score-one-for-the-tagesschau/",tags:"Y2004"},html:'<p>All the US blogs I\'ve read on the DNC <a href="http://www.dangerousmeta.com/?p=4013">have</a> <a href="http://www.buzzmachine.com/archives/2004_07_28.html#007607" title="BuzzMachine... by Jeff Jarvis">raved</a> <a href="http://www.davosnewbies.com/2004/07/28#onObama">about</a> the <a href="http://www.msnbc.com/modules/interactive.asp?id=/d/ip/dnc_tuesday_videos_152/data.js&navid=3032091&fmt=full&cp1=1">keynote </a> by <a href="http://www.newyorker.com/fact/content/?040531fa_fact1">Barack Obama</a>, but he hasn\'t been mentioned in any German media at all... except the <a href="http://blog.tagesschau.de/">new Tagesschau blog</a>. No feed, no permalinks, but they might have something right. (No, I haven\'t seen the speech yet. It\'s in Windows Media format, and  I haven\'t sat at a Windows machine yet today.)</p>'},next:{fields:{title:"Lack of diversity",date:"28 Jul 2004",slug:"/2004-07-28-lack-of-diversity/"}},previous:{fields:{title:"Swag",date:"29 Jul 2004",slug:"/2004-07-29-swag/"}}},{node:{fields:{title:"Lack of diversity",date:"28 Jul 2004",slug:"/2004-07-28-lack-of-diversity/",tags:"Y2004"},html:'<p><a href="http://waxtadpole.blogspot.com/2004_07_25_waxtadpole_archive.html#109098120009826333" title="European Misconceptions: The Press">Bite The Wax Tadpole: Lack of diversity in the European press</a>, although I imagine he means coverage of the US and not as a whole</p>'},next:{fields:{title:"Convention Coverage",date:"28 Jul 2004",slug:"/2004-07-28-convention-coverage/"}},previous:{fields:{title:"Score One for the Tagesschau",date:"28 Jul 2004",slug:"/2004-07-28-score-one-for-the-tagesschau/"}}},{node:{fields:{title:"Convention Coverage",date:"28 Jul 2004",slug:"/2004-07-28-convention-coverage/",tags:"Y2004"},html:'<p>If you\'re looking for <em>interesting</em> convention coverage, check out <a href="http://newyork.ninjastu.com/">Adam Fuller</a>. He\'s one of the techs trying to keep the WiFi up and running in Boston, and he says that <a href="http://newyork.ninjastu.com/archives/000124.html">bloggers stink</a>. Literally. <a href="http://q.queso.com/archives/001446">(via Q Daily News)</a></p>'},next:{fields:{title:"What's the big deal?",date:"27 Jul 2004",slug:"/2004-07-27-whats-the-big-deal/"}},previous:{fields:{title:"Lack of diversity",date:"28 Jul 2004",slug:"/2004-07-28-lack-of-diversity/"}}}],pathPrefix:"",first:!1,last:!1,index:444,pageCount:1101}}}});
